Les visiteurs 1 plot summary:

A medieval nobleman and his squire are accidentally transported to contemporary times 
by a senile sorcerer. He enlists the aid of his descendent to try to find a way to return home, all the while trying to cope with the cultural and technological changes distinguishing his time from ours. &lt;a href=&quot;
http://imdb.com/title/tt0108500/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://imdb.com/title/tt0108500/&lt;/a&gt;

Les visiteurs 2 plot summary:

The sequel to The Visitors reunites us with those lovable ruffians from the French Medieval ages who - through magic - are transported into the present, with often drastic consequences. Godefroy de Montmirail travels to today to recover the missing family jewels and a sacred relic, guarantor of his wife-to-be&amp;#039;s fertility. The confrontation between Godefroy&amp;#039;s repellent servant Jack the Crack and his descendent, the effete Jacquart, present-day owner of the chateau, further complicates the matter. &lt;a href=&quot;
http://imdb.com/title/tt0120882/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
